import com.example.demo.model.User;
import com.example.demo.service.UserService;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.web.bind.annotation.*;

import java.util.List;

@RestController
@RequestMapping(""/user"")
public class UserController {

    @Autowired
    private UserService userService;

    @GetMapping(""/all"")
    public List<User> getAllUsers(){
        return userService.getAllUsers();
    }

    @PostMapping(""/add"")
    public void addUser(@RequestBody User user){
        userService.addUser(user);
    }

    @PutMapping(""/update"")
    public void updateUser(@RequestBody User user){
        userService.updateUser(user);
    }

    @DeleteMapping(""/delete/{id}"")
    public void deleteUser(@PathVariable int id){
        userService.deleteUser(id);
    }

}

    public void testGetAll() {
        List<User> users = userService.getAll();
        assertNotNull(users);
        assertTrue(users.size() > 0);
    }

    @Test
    public void testGetById() {
        User user = userService.getById(1);
        assertNotNull(user);
    }

    @Test
    public void testSave() {
        User user = new User();
        user.setName(""Test"");
        user.setAge(30);
        user.setAdmin(true);
        user.setCreatedDate(new Date());

        userService.save(user);
        assertTrue(user.getId() > 0);
    }

    @Test
    public void testUpdate() {
        User user = userService.getById(1);
        user.setAdmin(false);
        userService.update(user);

        User updatedUser = userService.getById(1);
        assertFalse(updatedUser.isAdmin());
    }

    @Test
    public void testDelete() {
        int id = 2;
        userService.delete(id);

        User user = userService.getById(id);
        assertNull(user);
    }

}

int main(void)
{
    int n, i, j;

    printf(""Enter size of magic square: "");
    scanf(""%d"", &n);

    int magic_square[n][n];

    // set all slots as 0
    for (i = 0; i < n; i++)
    {
        for (j = 0; j < n; j++)
            magic_square[i][j] = 0;
    }

    // Initialize position for 1
    i = n / 2;
    j = n - 1;

    // One by one put all values in magic square
    for (int num = 1; num <= n * n;)
    {
        if (i == -1 && j == n) // 3rd condition
        {
            j = n - 2;
            i = 0;
        }
        else
        {
            // 1st condition helper if next number
            // goes to out of square's right side
            if (j == n)
                j = 0;

            // 1st condition helper if next number
            // is goes to out of square's upper side
            if (i < 0)
                i = n - 1;
        }
        if (magic_square[i][j]) // 2nd condition
        {
            j -= 2;
            i++;
            continue;
        }
        else
            magic_square[i][j] = num++; // set number

        j++;
        i--; // 1st condition
    }

    // Print magic square
    printf(""The Magic Square for n=%d:
Sum of each row or column %d:

"",
           n, n * (n * n + 1) / 2);
    for (i = 0; i < n; i++)
    {
        for (j = 0; j < n; j++)
            printf(""%3d "", magic_square[i][j]);
        printf(""
"");
    }

    return 0;
}

